<script>
	let props = $props();
	let close = $state(true);

	$effect(() => {
		if (props.error[0] == null) {
			close = true;
		} else {
			close = false;
		}
	});

	const onclick = () => {
		close = true;
	};
</script>

<style>
    * {
        margin: 0;
        padding: 0;
    }

    .error {
        z-index: 9999;
        position: absolute;
        width: 100vw;
        height: 100vh;
        backdrop-filter: blur(4px);
        -webkit-backdrop-filter: blur(4px);
        display: flex;
        justify-content: center;
        align-items: center;
    }

    .error .popup {
        background: rgba(0, 0, 0, 0.5);
        backdrop-filter: blur(11.5px);
        -webkit-backdrop-filter: blur(11.5px);
        border-radius: 1rem;
        width: 75%;
        height: 75%;
        display: flex;
        flex-direction: column;
        justify-content: space-evenly;
        align-items: center;
        color: white;
        padding: 1rem;
    }

    .error .popup img {
        height: 25vh;
    }

    .error .popup h1 {
        font-family: Lexend, sans-serif;
        font-size: 1.5vw;
    }

    .error .popup ol {
        font-family: Comfortaa, sans-serif;
        font-size: 1.22vw;
        overflow-y: auto;
        width: 75%;
        display: flex;
        flex-direction: column;
        align-items: center;
        margin: 0.5rem;
    }

    .error .popup button {
        font-family: Comfortaa, sans-serif;
        background: white;
        width: 25%;
        border: none;
        border-radius: 1rem;
        padding: 0.5rem;
        font-size: 1.5vw;
        cursor: pointer;
    }

    .error .popup button:hover {
        background: #ececec;
        -webkit-box-shadow: 0 0 95px 5px var(--background-color, #ffffff);
        -moz-box-shadow: 0 0 95px 5px var(--background-color, #ffffff);
        box-shadow: 0 0 95px 5px var(--background-color, #ffffff);
        transition: box-shadow 0.2s ease-in;
    }

    @media (max-width: 1170px) {
        .error .popup h1 {
            font-size: 3vw;
        }

        .error .popup ol {
            font-size: 2.5vw;
        }

        .error .popup button {
            font-size: 2vw;
            width: 50%;
        }
    }

    @media (max-width: 450px) {
        .error .popup h1 {
            font-size: 4vw;
        }

        .error .popup ol {
            font-size: 5vw;
        }

        .error .popup button {
            font-size: 5vw;
            width: 50%;
        }
    }
</style>

<section class="error" style={close ? "display:none" : ""} {onclick}>
	<div class="popup">
		<img
			draggable="false"
			src="data:image/gif;base64, "
			alt="Lost in Clouds"
		/>
		<h1>It seems Like an Error Occurred!</h1>
		<ol>
			{#each props.error as err}
				<li>{err}</li>
			{/each}
		</ol>
		<button {onclick}>Okay !</button>
	</div>
</section>